const Navbar = () => {
    return (
        <nav className="navbar">
            <h1>the MINI TURBO DERBY</h1>
            <div>
                <a href="/">Home</a>
                <a href="/create" style={{
                    color: "white"
                }}>New Blog</a>
            </div>
        </nav>
    );
}
 
export default Navbar;
